const SpeakerSchedule = () => {
  return (
    <div className="speaker-schedule">
      <h2 className="schedule-title">üé§ Meet Our Esteemed Speakers</h2>
      <p className="speaker-intro">Explore insights from industry leaders shaping the future of technology.</p>

      <ul className="speaker-list">
        <li className="speaker-item">‚ú® <strong>John Doe</strong> - AI & ML Innovations</li>
        <li className="speaker-item">üöÄ <strong>Jane Smith</strong> - The Future of Web Development</li>
        <li className="speaker-item">üîç <strong>Alex Johnson</strong> - Cybersecurity Trends</li>
        <li className="speaker-item">üì± <strong>Emily Davis</strong> - Mobile UX Design</li>
        <li className="speaker-item">üí° <strong>Chris Brown</strong> - Cloud & DevOps Strategies</li>
      </ul>

      <p className="closing-remarks">üöÄ Get ready to innovate, learn, and connect at GDG TechSphere 2025!</p>
    </div>
  );
};

export default SpeakerSchedule;
